    true,nt"url": null,nt"notes": "<p>The State Ambulatory Surgery Databases
    (SASD) contain the universe of hospital-based ambulatory surgery encounters in participating
    States.  Some States include ambulatory surgery encounters from free-standing facilities
    as well. Restricted access data files are available with a data use agreement and
    brief online security training.</p>n<p>The data are translated into a uniform format
    to facilitate multi-State comparisons and analyses. The SASD include all patients
    in participating settings, regardless of payer, e.g., persons covered by Medicare,
    Medicaid, private insurance, and the uninsured.</p>n<p>The SASD contain clinical
    and resource use information included in a typical discharge abstract, with safeguards
    to protect the privacy of individual patients, physicians, and facilities (as required
    by data sources). Data elements include but are not limited to: diagnoses, procedures,
    admission and discharge status, patient demographics (e.g., gender, age), total
    charges, and expected payment source (e.g., Medicare, Medicaid, private insurance,
    self-pay; for some States, additional discrete payer categories, such as managed
    care). In addition to the core set of uniform data elements common to all SASD,
    some include State-specific data elements, such as the patient's race.  The SASD
    exclude data elements that could directly or indirectly identify individuals.  For
    some States, hospital and county identifiers are included that permit linkage to
    the American Hospital Association Annual Survey File and the Area Resource File.</p>n",nt"license_title":
